import React, { useState } from "react";
import Wyniki from "./components/Form/wyniki";

function App() {
  const Tablica = [
    {
      id: "1",
      imie: "chuj",
      wiek: 18,
    },
  ];
  const [newTablica, setNewTablica] = useState(Tablica);

  function ustawTablice(dane) {
    setNewTablica((preDane) => {
      return [dane, ...preDane];
    });
  }
  return <Wyniki  tablicaHandler={ustawTablice} danee={newTablica}/>;
}

export default App;
